Golden hour above & below the oldest & longest lava tube system in the world, a distinct reminder to this ancient lands volcanic history. 

If there’s one thing for certain from this trip on the savannah way is that this place is alive with history & experiences making it one of the more underrated road trips to take in Australia. 
@queensland @britzcampervans #thisisqueensland
@undaraexperience

Gaining elevation above the gulf & following the snaking Norman river from the outback to the sea. 

Travelling from Mt Isa we left the red earth rocky landscape for the flood plains & intricate river systems of the gulf, such a wild transition in a days drive and somewhere I’ve had on my list for what seems like forever. 
@queensland #thisisqueensland
